// Helper function to get product images
export function getProductImages(productId: string) {
  return productImages[productId as keyof typeof productImages] || productImages.fallback
}

// Helper function to get all configured product IDs
export function getConfiguredProductIds() {
  return Object.keys(productImages).filter(id => id !== 'fallback')
}